use lambdaworks_math::elliptic_curve::short_weierstrass::curves::bls12_381::default_types::FrField; fn main() { let system = &mut ConstraintSystem::<FrField>::new(); let x = system.new_public_input(); let y = system.new_public_input(); let e = system.new_variable(); let z = system.mul(&x, &e); // This constraint system asserts that x * e == y system.assert_eq(&y, &z);
} This code creates a constraint system over the field of the BLS12381 curve. Then, it creates three variables: two public inputs x and y, and a private variable e. Note that every variable is private except for the public inputs. Finally, it adds the constraints that represent a multiplication and an assertion. Before generating proofs for this system, we need to run a setup and obtain a verifying key: let common = CommonPreprocessedInput::from_constraint_system(&system, &ORDER_R_MINUS_1_ROOT_UNITY);
