Some operations are common, and it makes sense to wrap the set of constraints that do these operations in a function and use it several times. Lambdaworks comes with a collection of functions to help you build your own constraint systems, such as conditionals, inverses, and hash functions. However, if you have an operation that does not come with Lambdaworks, you can easily extend Lambdaworks functionality. Suppose that the exponentiation operation is something common in your program. You can write the square and multiply algorithm and put it inside a function: pub fn pow( system: &mut ConstraintSystem<FrField>, base: Variable, exponent: Variable,
) -> Variable { let exponent_bits = system.new_u32(&exponent); let mut result = system.new_constant(FieldElement::one()); for i in 0..32 { if i != 0 { result = system.mul(&result, &result); } let result_times_base = system.mul(&result, &base); result = system.if_else(&exponent_bits[i], &result_times_base, &result); } result
} This function can then be used to modify our simple program from the previous section. The following circuit checks that the prover knows e such that pow(x, e) = y: use lambdaworks_plonk::constraint_system::ConstraintSystem;
use lambdaworks_math::elliptic_curve::short_weierstrass::curves::bls12_381::default_types::FrField; fn main() { let system = &mut ConstraintSystem::<FrField>::new(); let x = system.new_public_input(); let y = system.new_public_input(); let e = system.new_variable(); let z = pow(system, &x, &e); system.assert_eq(&y, &z);
} You can keep composing these functions in order to create more complex systems.

