) -> BoundaryConstraints<Self::Field> { let a0 = BoundaryConstraint::new_simple(0, self.pub_inputs.a0.clone()); let a1 = BoundaryConstraint::new_simple(1, self.pub_inputs.a1.clone()); BoundaryConstraints::from_constraints(vec![a0, a1])
} The BoundaryConstraint struct represents a specific boundary constraint, meaning "column i at row j should be equal to x". In this case, because we have only one column, we are using the new_simple method to simply say Row 0 should equal the public input a0, which in the typical fibonacci is set to 1. Row 1 should equal the public input a1, which in the typical fibonacci is set to 1. In the case of multiple columns, the new method exists so you can also specify column number. After instantiating each of these constraints, we return all of them through the struct BoundaryConstraints.
